// Old counters: ['PAPI_VEC_SP', 'PAPI_VEC_DP', 'PAPI_SP_OPS', 'PAPI_DP_OPS']
// New counters (Split out): VEC_SP: ['0x40000025' (SCALAR_SINGLE), '0x40000026' (128B_PACKED_SINGLE), '0x40000027' (256B_PACKED_SINGLE), '0x40000028' (512B_PACKED_SINGLE)], ['0x40000025', '0x40000026', '0x40000027', '0x40000028']
// New counters (Split out): VEC_DP: ['0x40000021' (SCALAR_DOUBLE), '0x40000022' (128B_PACKED_DOUBLE), '0x40000023' (256B_PACKED_DOUBLE), '0x40000024' (512B_PACKED_DOUBLE)], ['0x40000021', '0x40000022', '0x40000023', '0x40000024']
// Merged: ['0x40000025', '0x40000026', '0x40000027', '0x40000028', '0x40000021', '0x40000022', '0x40000023', '0x40000024']

class SuperSectionVectorizationAnalysis {
    constructor(section, nodeid, stateid, critical_path_analysis) {
        this.section = section;
        this.critical_path_analysis = critical_path_analysis;
        this.for_node = nodeid;
        this.for_state = stateid;
        this.analysis_result = null;

        if(!(stateid == 0xFFFF || stateid == 65535))
            ObjectHelper.assert("for_node defined", this.for_node != undefined && new Number(this.for_node) != NaN);
    }

    judgement(analysis = null) {
        if (analysis == null) analysis = this.analysis_result.data;

        return SuperSectionVectorizationAnalysis.sjudgement(analysis);
    }

    static sjudgement(analysis) {

        // What's a good definition for vectorized operation?
        // Let's just take that the amount of vector instructions must exceed the amount of scalar operations.
        // Rationale: Even vectorized segments might have some scalar elements, and one vector instruction does not imply complete and good vectorization.
        // With # vec ops > # scalar ops, we get an approximation that works everywhere except in very large and diverse sections and very small sections.

        let sp_vec_op_count = MathHelper.sum(analysis.sp_ops_128b) + MathHelper.sum(analysis.sp_ops_256b) + MathHelper.sum(analysis.sp_ops_512b);
        let dp_vec_op_count = MathHelper.sum(analysis.dp_ops_128b) + MathHelper.sum(analysis.dp_ops_256b) + MathHelper.sum(analysis.dp_ops_512b);

        let sp_scalar_op_count = MathHelper.sum(analysis.sp_ops_scalar);
        let dp_scalar_op_count = MathHelper.sum(analysis.dp_ops_scalar);

        if(sp_scalar_op_count + dp_scalar_op_count < sp_vec_op_count + dp_vec_op_count)
            return 1;
        else
            return -1;
    }

    analyze() {
        let section = this.section;

        ObjectHelper.assert("section is SuperSection", section instanceof SuperSection);

        section = section.toSection(this.for_node, this.for_state);
        if(section == undefined) {
            return null;
        }
        if(section['_entries'] == undefined) {
            return null;
        }

        let b_print_analysis = false;   // Set to true to debug.

        let data = {};

        let max_thread_num = Number(section.get_max_thread_num());
        let min_thread_num = Number(section.get_min_thread_num());

        if(max_thread_num == undefined || min_thread_num == undefined) {
            // We got one of those cases where we have an empty section - usually due to empty tasklets or empty states
            return undefined;
        }
        if (b_print_analysis)
            console.log("max_thread_num: " + max_thread_num);
        
        let sp_ops = [];
        let dp_ops = [];


        let sp_flops = [];
        let dp_flops = [];
        let sp_ops_scalar_single = [];
        let sp_ops_128b_single = [];
        let sp_ops_256b_single = [];
        let sp_ops_512b_single = [];

        let sp_ops_scalar_double = [];
        let sp_ops_128b_double = [];
        let sp_ops_256b_double = [];
        let sp_ops_512b_double = [];

        let tot_cycles = [];

        for (let t = min_thread_num; t < max_thread_num + 1; t++) {
            let ts = section.select_thread(t);
            let tc = ts.select_event('-2147483589'); // PAPI_TOT_CYC
            tot_cycles.push(MathHelper.sum(tc));
            let t_sp = ts.select_event('-2147483545', true); // PAPI_SP_OPS
            let tmp_single = ts.select_event('1073741861'); sp_ops_scalar_single.push(MathHelper.sum(tmp_single));
            tmp_single = ts.select_event('1073741862'); sp_ops_128b_single.push(MathHelper.sum(tmp_single));
            tmp_single = ts.select_event('1073741863'); sp_ops_256b_single.push(MathHelper.sum(tmp_single));
            tmp_single = ts.select_event('1073741864'); sp_ops_512b_single.push(MathHelper.sum(tmp_single));

            let t_sp_sum = MathHelper.sum(t_sp);
            sp_ops.push(t_sp_sum);

            // =====================================

            let t_dp = ts.select_event('-2147483544', true); // PAPI_DP_OPS
            let tmp_double = ts.select_event('1073741857'); sp_ops_scalar_double.push(MathHelper.sum(tmp_double));
            tmp_double = ts.select_event('1073741858'); sp_ops_128b_double.push(MathHelper.sum(tmp_double));
            tmp_double = ts.select_event('1073741859'); sp_ops_256b_double.push(MathHelper.sum(tmp_double));
            tmp_double = ts.select_event('1073741860'); sp_ops_512b_double.push(MathHelper.sum(tmp_double));
            let t_dp_sum = MathHelper.sum(t_dp);
            dp_ops.push(t_dp_sum);
        }

        if(sp_ops.length == 0)
            sp_ops = MathHelper.sum(sp_ops_scalar_single) + MathHelper.sum(sp_ops_128b_single) + MathHelper.sum(sp_ops_256b_single) + MathHelper.sum(sp_ops_512b_single);
        if(dp_ops.length == 0) 
            dp_ops = MathHelper.sum(sp_ops_scalar_double) + MathHelper.sum(sp_ops_128b_double) + MathHelper.sum(sp_ops_256b_double) + MathHelper.sum(sp_ops_512b_double);

        ObjectHelper.logObject("sp_ops", sp_ops);
        ObjectHelper.logObject("dp_ops", dp_ops);

        // This is in _FL_oating point _OP_eration_S_. Nothing with time.
        //sp_flops = MathHelper.sum(sp_ops_scalar_single) * 1 + MathHelper.sum(sp_ops_128b_single) * 4 + MathHelper.sum(sp_ops_256b_single) * 8 + MathHelper.sum(sp_ops_512b_single) * 16;
        //dp_flops = MathHelper.sum(sp_ops_scalar_double) * 1 + MathHelper.sum(sp_ops_128b_double) * 2 + MathHelper.sum(sp_ops_256b_double) * 4 + MathHelper.sum(sp_ops_512b_double) * 8;

        let flop_each_thread = x => {
            // We have in x: [[scalar_t1, scalar_t2, ...], [packed1_t1, packed1_t2, ...], ...]
            // We want to add these inner arrays together.
            let zipped = MathHelper.zip2d(x);
            // Now we can map each element of zipped to its sum to get flop per thread
            let summed = zipped.map(x => MathHelper.sum(x));
            return summed;
        };
        sp_flops = flop_each_thread([sp_ops_scalar_single.map(x => x * 1), sp_ops_128b_single.map(x => x * 4), sp_ops_256b_single.map(x => x * 8), sp_ops_512b_single.map(x => x * 16)]);
        dp_flops = flop_each_thread([sp_ops_scalar_double.map(x => x * 1), sp_ops_128b_double.map(x => x * 2), sp_ops_256b_double.map(x => x * 4), sp_ops_512b_double.map(x => x * 8)]);

        ObjectHelper.logObject("sp_flops", sp_flops);
        ObjectHelper.logObject("dp_flops", dp_flops);

        data.sp_flops = sp_flops; // Number of floating point operations
        data.dp_flops = dp_flops;

        ObjectHelper.logObject("tot_cycles", tot_cycles);

        data.sp_flops_per_cycle = MathHelper.zip(data.sp_flops, tot_cycles).map(x => x[0] / x[1]); // FLOPC (Flops per Cycle)
        data.dp_flops_per_cycle = MathHelper.zip(data.dp_flops, tot_cycles).map(x => x[0] / x[1]);

        // Get the median of all critical paths for the maximum amount of threads
        let crit_path = MathHelper.median(max_func_obj(this.critical_path_analysis.data.critical_paths, x => x.thread_num, x => x.value));
        data.sp_flops_per_cycle_parallel = MathHelper.sum(data.sp_flops) / crit_path; // FLOPC (Flops per Cycle) added over all threads
        data.dp_flops_per_cycle_parallel = MathHelper.sum(data.dp_flops) / crit_path;

        data.sp_ops = sp_ops; // Number of instructions
        data.dp_ops = dp_ops;

        data.sp_ops_scalar = sp_ops_scalar_single;
        data.sp_ops_128b = sp_ops_128b_single;
        data.sp_ops_256b = sp_ops_256b_single;
        data.sp_ops_512b = sp_ops_512b_single;

        data.dp_ops_scalar = sp_ops_scalar_double;
        data.dp_ops_128b = sp_ops_128b_double;
        data.dp_ops_256b = sp_ops_256b_double;
        data.dp_ops_512b = sp_ops_512b_double;

        ObjectHelper.logObject("data", data);

        if(sp_ops.length == 0) {
            return undefined;
        }
        
        let ret = new DataBlock(data, "vectorized");
        this.analysis_result = ret;
        ret.judgement = this.judgement();
        return ret;
    }
}

class LazySuperSectionVectorizationAnalysis extends SuperSectionVectorizationAnalysis {

    constructor(communicator, section, nodeid, stateid, critical_path_analysis) {
        super(section, nodeid, stateid, critical_path_analysis, null);
        this.communicator = communicator;
    }

    async analyze() {
        // We differ from the eager analysis here: We let the python/sql-side do the hard work

        let section = this.section.toSection(this.for_node, this.for_state);
        section = await section;
        if(section === undefined) {
            return undefined;
        }
        let tmp = await this.communicator.runAnalysis("VectorizationAnalysis", [new Number(section.unified_id), new Number(section.supersection_id)]).get();

        let data = tmp;

        let ret = new DataBlock(data, "vectorization");
        this.analysis_result = ret;
        ret.judgement = this.judgement();
        return ret;
    }
}

function AutoSuperSectionVectorizationAnalysis(communicator, section, nodeid, stateid, critical_path_analysis) {
    if(section instanceof LazySuperSection) {
        return new LazySuperSectionVectorizationAnalysis(communicator, section, nodeid, stateid);
    }
    else {
        return new SuperSectionVectorizationAnalysis(section, nodeid, stateid, critical_path_analysis);
    }
}


export { VectorizationButton, AutoSuperSectionVectorizationAnalysis, SuperSectionVectorizationAnalysis};